  \"2016-07-27T22:44:24.595790\",\n\t\"name\": \"narrative-report-bear-river-migratory-bird-refuge-for-the-period-january-1-1959-to-ap-30-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bear River Migratory
  Bird Refuge outlines Refuge accomplishments from January through April of 1959.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
  raptors, fish, reptiles, and disease- is also covered. The Refuge development and
  maintenance section discusses physical developments and prescribed burning. Resource
  management is outlined; topics include fur harvesting and commercial fishing. A
  progress report on field investigations and applied research is also provided. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, and violations. Items of interest, N-R forms, and
  photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
